import React from 'react';
import { Button } from '@mui/material';
function PokemonAdd({addPokemon}) {
    const handleClick = e => {
        addPokemon();
    }
    return (
    <Button
    onClick={handleClick}>
        Add Pokemon
    </Button>);

}

export default PokemonAdd;
